verses.text:
Dominō est salūs; 
super populum tuum benedictio tua.  
Selah.

Dum clāmō, respondē mihi Deus jūstitiae meae:
in angustiā dīlātāstī mihi; 
miserēre meī, et audī precātiōnem meam.

Contemptus in oculīs ejus rejectus; 
quī vērō timentēs Dominum honōrat.
Quum jūrāverit ad damnum īnferendum, nōn mūtat.

Pōnēs eōs tanquam in fornācem īgnis in tempore īrae tuae; 
Jehova in īrā suā opprimet eōs 
et cōnsūmet eōs īgnis.

Fugam meam tū in numerātō habēs; 
pōne lachrymās meās in utre tuō:
 annōn in commentāriō tuō?

Ut videam beneficentiam ēlēctōrum tuōrum; 
ut laeter in laetitiā gentis tuae, 
ut glōrier cum haerēditāte tuā.
